import JumboFAQ from "../components/JumboFAQ.js";
import CTABonus from "../components/CTABonus.js";
import USPDiv from "../components/USPDiv.js";
import Faqquestions2 from "../components/faqquestions";

class faq extends React.Component {
  render() {
    return (
        <div>
          <JumboFAQ />
          <Faqquestions2 />
        </div>
    )
  }
}

export default faq;
